import csv

file = open('data.csv', 'r')
data = csv.reader(file)

img = """
data:image/jpeg;base64,
"""


def getHTMLString(company, role, name):
  html_text = f"""
      <div class="name_box">
        <div class="top_align">
          <img class="logo" src="{img}" />
          <p class="title">{company}</p>
        </div>
        <div class="align_box">
          <p class="text_color role">{role}</p>
          <p class="text_color name">{name}</p>
        </div>
      </div>
    </div>
  """
  return """<div class="border_box">""" + html_text + "</div>" + """<div class="border_box pagination">""" + html_text + "</div>"

html_start = """
<!DOCTYPE html>
<html lang="ko">
  <head>
    <meta charset="UTF-8" />
    <meta name="viewport" content="width=device-width, initial-scale=1.0" />
    <title>Document</title>
  </head>
  <body>
"""

html_middle = ""

html_end = """
    <style>
      .border_box { width: 848px; height: 290px; border: 2px solid #333; padding: 5px; margin-bottom: 20px; }
      .pagination { page-break-after: always; }
      .name_box { border: 4px solid rgb(17, 132, 206); width: 840px; height: 280px; }
      .align_box { display: flex; justify-content: space-around; align-items: center; }
      .top_align { display: flex; justify-content: center; align-items: center; }
      .title { color: rgb(17, 132, 206); font-size: 3rem; font-weight: 600; margin-top: 2.5rem; margin-left: 1rem; margin-bottom: 1rem; text-align: center; }
      .logo { width: 9rem; height: 9rem; margin-right: 1rem; display: block; object-fit: cover; z-index: -1; }
      .text-align { text-align: center; }
      .text_color { color: rgb(56, 53, 70); }
      .role { font-size: 4rem; margin-top: 0.5rem; }
      .name { font-size: 5rem; font-weight: 600; margin-top: 1.5rem;}
    </style>
    <link rel="stylesheet" href="./design.css" />
  </body>
</html>
"""

for index, line in enumerate(data):
  if index < 2:
    continue
  html_middle += getHTMLString(line[0], line[1], line[2])

html_file = open('result.html', 'w')
html_file.write(html_start + html_middle + html_end)
html_file.close()

input("종료하려면 Enter를 눌러주세요")